import React, { useState,useEffect } from 'react'
import '../App.css'
import Menu from '../images/menu.png'
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import { ListItemText } from "@mui/material";

export default function Navbar() {
    const [state, setState] = React.useState({
        left: false,
    });
  return (
    <div>
        <nav>
            <div className='flex justify-center items-center bg-black h-32'>
                <p className='text-white font-bold text-5xl font-mono shadow-white'>Navbar</p>
            </div>
            <div className="flex justify-end -translate-y-28">
                {[''].map((anchor) => (
                    <React.Fragment key={anchor}>
                        <Button onClick={toggleDrawer(anchor, true)} className="w-8">
                                <img className='men w-8 ' alt="menu" src={menu} />
                        </Button>
                        <Drawer
                            anchor={anchor}
                            open={state[anchor]}
                            onClose={toggleDrawer(anchor, false)}
                        >
                            {list(anchor, userData)}
                        </Drawer>
                    </React.Fragment>
                ))}
            </div>
        </nav>
    </div>
  )
}
